import React from 'react';
import '../styles.css';

const Numerology = () => {
  return (
    <div className="page multicolor-border p-4 rounded-2xl shadow-lg">
      <h1 className="text-3xl font-bold mb-4">Numerology</h1>
      <p>Numerology studies the mystical meaning of numbers and their influence on life paths, personality, and destiny. Each number is thought to carry specific vibrations.</p>
      <p>For example, the number 7 is often associated with inner wisdom, spirituality, and truth-seeking. Birth dates and names are analyzed to reveal a personâ€™s "life path number."</p>
      <p>Numerology has roots in ancient cultures including Egypt, Greece (Pythagoras), and Babylon, and continues to be used in modern spiritual frameworks.</p>
    </div>
  );
};

export default Numerology;
